//App.js
import React, { useEffect } from "react";
import './App.css';
import Login from "./components/Login";
import Salir from "./components/Salir";
import Home from "./components/Home";
import Usuarios from "./components/Usuarios";
import Libros from "./components/Libros";
import NavDropdown from 'react-bootstrap/NavDropdown';

import {
    BrowserRouter as Router,
    Route,
    Link,
    Routes,
    Outlet,
} from "react-router-dom";

import { Navbar, Nav } from "react-bootstrap";
import { Toaster } from 'react-hot-toast';
const [data, set_data] = useState([]);

function NotFound() {
    return (
        <div>
            <h2>No se pudo encontrar la pagina</h2>
            <p>Lo sentimos, la pagina web que esta tratando de cargar no existe.</p>
        </div>
    );
}

function get_nombre() {
    let nombre = (localStorage.getItem('nombre'));
    return nombre;
}

function get_profile() {
    try {
        let permiso = localStorage.getItem('privilegio');
        async function Buscar_data() {
            try {
              const response = await fetch('http://localhost:4000/permios/' + permiso);
              if (response.ok) {
                response.json().then(data => set_data(data))
              }
            } catch (error) {

            }
          }

          useEffect(() => {
            Buscar_data();
          });
        if (get_nombre() == null) {
            return (
                <Nav.Link className="text-white" as={Link} to="/Login">
                    Iniciar session
                </Nav.Link>
            );
        } else {
            if (get_nombre().length < 1) {

                return (
                    <Nav.Link className="text-white" as={Link} to="/Login">
                        Iniciar session
                    </Nav.Link>
                );

            } else if (permiso === '1') {
                return (
                    <NavDropdown title="Menu del usuario" id="basic-nav-dropdown">
                        <p className="text-center mayus"> {get_nombre()}</p>
                        <NavDropdown.Divider />
                        {data.map(elemento => {
                           return <Nav.Link className="mayus" as={Link} to={'/' + elemento}  onClick={e => {
                            document.getElementById('basic-nav-dropdown').click();
                        }}>
                            {elemento}
                        </Nav.Link>
                        })}
                        <NavDropdown.Divider />
                        <Nav.Link as={Link} to="/Salir">
                            Salir
                        </Nav.Link>
                    </NavDropdown>
                );
            }
        }
    } catch (error) {

    }
}

function App() {
    useEffect(() => {
        document.title = 'LibroWiki';
    }, []);
    return (
        <Router>
            <Navbar bg="dark" expand="lg">
                <Navbar.Brand>
                    <h1 className="ml-3" style={{ color: "green" }}>LibroWiki</h1>
                </Navbar.Brand>
                <Toaster
                    position="bottom-right"
                    reverseOrder={false}
                />
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link className="text-white" as={Link} to="/Home" exact>
                            Inicio
                        </Nav.Link>
                        {get_profile()}
                    </Nav>
                </Navbar.Collapse>
            </Navbar>

            <div className="container mt-4">
                <Routes>
                    <Route path="/" element={<Outlet />}>
                        <Route path="/" element={<Home />} />
                        <Route path="/Home" element={<Home />} />
                        <Route path="/Salir" element={<Salir />} />
                        <Route path="/Libros" element={<Libros />} />
                        <Route path="/Usuarios" element={<Usuarios />} />
                        <Route path="/Login" element={<Login />} />
                        <Route path="*" element={<NotFound />} />
                    </Route>
                </Routes>
            </div>
            <Navbar className="footer" bg="dark" expand="lg">
                <Navbar.Brand>
                    <h2 className="ml-3" style={{ color: "green" }}>Tp de Elizabeth Denett</h2>
                </Navbar.Brand>
            </Navbar>
        </Router>

    );

}
export default App;
